<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=\, initial-scale=1.0" />

    <title>Harley Davidson</title>
    <!-- <script type="module" src="/src/app.js"></script> -->
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css">
    <style>
      @import url('https://fonts.googleapis.com/css2?family=Abril+Fatface&family=Courgette&family=Dancing+Script:wght@400;700&family=Great+Vibes&family=Josefin+Sans:wght@300;400;600&family=Limelight&family=Lobster&family=Montserrat:wght@300;400;600&family=Oleo+Script+Swash+Caps:wght@400;700&family=Poppins:wght@300;400;700;800&family=Raleway:ital,wght@0,400;1,300;1,600&display=swap');
      @import url('https://fonts.googleapis.com/css2?family=Arizonia&family=Brawler:wght@400;700&family=Croissant+One&family=Ephesis&family=Gloock&family=Hurricane&family=Imbue:opsz,wght@10..100,100..900&family=Modak&family=Montez&family=Prosto+One&family=Rye&family=Shojumaru&family=Young+Serif&family=ZCOOL+XiaoWei&display=swap');

      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      a {
        display: inline-block;
        text-decoration: none;
      }

      .svg {
        position: absolute;
        width: 0;
        height: 0;
      }
      
      body {
        min-height: 100vh;
        padding: 3rem;
        display: flex;
        font-family: 'Oleo Script Swash Caps', cursive;
        background-color: whitesmoke;
        overflow-x: hidden;
      }

      .page {
        position: relative;
        width: 100%;
        max-width: 100rem;
        margin: auto;
        padding: min(5vw, 3rem);
        border-radius: 16px;
        box-shadow: 3px 3px 6px #0005, 
                  -3px -3px 6px #fff2;
        background: linear-gradient(
          to right,#49a3eb,#316289);
      }

      header {
        position: relative;
        display: flex;
        column-gap: 3rem;
        row-gap: 2rem;
        flex-wrap: wrap;
        align-items: center;
        justify-content: space-between;
        z-index: 3;
      }

      nav {
        width: 90%;
        margin: auto;
        padding: min(4vw, 2rem) 0;
        display: flex;
        flex-wrap: wrap;
        align-items: center;
        justify-content: space-between;
      }

      .logo {
        text-transform: uppercase;
        cursor: pointer;
      }
      .logo img {
        max-width: 2.25rem;
      }

      .nav-items ul {
        display: flex;
        column-gap: 3rem;
        row-gap: 1rem;
        flex-wrap: wrap;
        align-items: center;
        list-style-type: none;
      }

      .icons {
        display: flex;
        gap: 2rem;
        align-items: center;
      }
      .icons img {
        cursor: pointer;
      }

      .nav-items ul li {
        position: relative;
        padding: 0.9em 0.3em;
        color: #fff;
        font-size: 1.125rem;
        font-weight: 500;
        font-family: "Croissant One", serif;
        text-transform: uppercase;
        cursor: pointer;
      }
      .nav-items ul li::after {
        position: absolute;
        bottom: 0;
        left: 0;
        content: '';
        width: 100%;
        height: 2px;
        background-color: #fff;
        transform-origin: left;
        transform: scaleX(0);
        transition: transform 600ms;
      }
      .nav-items ul li:hover::after {
        transform: scaleX(1);
      }
      
      .transparent-mask {
        position: absolute;
        top: 0;
        right: 0;
        height: 100%;
        border-radius: 16px;
        overflow: hidden;
      }
      .transparent-mask img {
        height: 100%;
        display: block;
        margin-left: auto;
      }

      .title {
        position: relative;
        padding: min(12vw, 6.25rem) 0;
        color: transparent;
        font-weight: 900;
        text-align: center;
        text-transform: capitalize;
        -webkit-text-stroke: 1px #fff;
        filter: drop-shadow(1px 1px 1px #000);
        z-index: 1;
      }
      .title h1 {
        font-size: min(calc(1rem + 9vw), 12.5rem);
        font-weight: 900;
        line-height: 1;
      }
      .title span {
        display: block;
        padding-top: 0.2em;
        font-size: min(calc(0.75rem + 7vw), 10rem);
      }

      .product-details {
        position: relative;
        width: 100%;
        display: flex;
        flex-wrap: wrap;
        justify-content: space-between;
        color: #cce1f1;
        text-shadow: 1px 1px 1px #0008;
        z-index: 3;
      }
      
      .icon {
        max-width: 3.75rem;
        max-height: 3.75rem;
        margin: 1.5rem 0.5rem;
        border-radius: 50%;
        border: 1px solid #000;
        background-color: #fff;
        transition: filter 400ms;
        cursor: pointer;
      }
      .icon img {
        width: 100%;
      }
      .icon:hover {
        filter: invert(1);
      }
        
      .details h2 {
        font-size: min(calc(1rem + 7vw), 5rem);
        font-weight: 700;
        text-transform: capitalize;
      }
      .details h2 span {
        display: block;
        font-size: min(calc(1rem + 4vw), 4rem);
        font-weight: 700;
        text-transform: capitalize;
      }
      
      .ratings {
        display: flex;
        gap: 2.5rem;
        flex-wrap: wrap;
        align-items: center;
      }
      
      .votes {
        display: flex;
        gap: 2rem;
      }
      .votes p {
        font-size: 1.25rem;
        font-weight: 500;
      }
      
      .details > p {
        font-size: 1.1rem;
        font-weight: 400;
        text-transform: capitalize;
        font-family: "Croissant One", serif;
      }
      
      .main-img {
        position: absolute;
        top: 2%;
        right: 0;
        height: 106%;
        z-index: 2;
      }
      .main-img img {
        max-width: 95vw;
        display: block;
        margin-left: auto;
      }
      
      .bg {
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        opacity: 0.1;
      }
      .bg img {
        width: 100%;
        height: 100%;
        object-fit: contain;
        object-position: top right;
      }
      
      .bg-logo {
        position: absolute;
        top: 0;
        right: 0;
        max-width: max(50%, 1800px);
        z-index: -1;
      }

      /* 1280px */
      @media screen and (max-width: 80rem) {
        body {
          padding: 0;
        }
        .page {
          min-height: 100vh;
          border-radius: 0;
        }
        .nav-items {
          order: 3;
        }
        .nav-items ul li {
          padding: 4px;
        }
        .icons {
          filter: invert(1);
        }
        .hero-section {
          display: flex;
          flex-direction: column;
        }
        .title {
          order: 1;
        }
        .main-img {
          position: relative;
          height: auto;
          order: 2;
        }
        .main-img img {
          width: 104%;
        }
        .main-img::before {
          position: absolute;
          top: 0;
          left: 0;
          content: "";
          width: 100%;
          height: 100%;
          background-color: #fff;
          clip-path: url("#mask-3");
          z-index: -1;
        }
        .product-details {
          order: 3;
        }
        .transparent-mask {
          display: none;
        }
        .bg {
          display: none;
        }
      }

      /* 1000px */
      @media screen and (max-width: 62.5rem) {
        .icon {
          display: inline-block;
        }
        .product-details {
          display: block;
        }
      }

      /* 1800px */
      @media screen and (min-width: 112.5rem) {
        .main-img img {
          height: 100%;
        }
      }
    </style>
  </head>

              </div>
              <div class="votes">
                <p>4.6/5</p>

              </div>
            </div>
            <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Tempora, adipisci?</p>
          </div>
  
          <div class="socialmedia-icons">
            <div class="icon">
              <img src="./img/fb.png" alt="">
            </div>
            <div class="icon">
              <img src="./img/twitter.png" alt="">

            <div class="icon">

        <div class="main-img">

      </div>

    </div>

    <div class="bg">
      <img src="./img/bg-bike.png">
      <img src="./img/bg-route-logo.png" alt="" class="bg-logo">
    </div>
